import React, { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";
import { getUserById, updateUser } from "../../services/userService";

const EditUserAdmin = () => {
  const navigate = useNavigate();
  const { userId } = useParams();
  const [user, setUser] = useState({
    username: "",
    email: "",
    full_name: "",
    user_type: "",
    password: "",
  });

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const userData = await getUserById(userId);
        setUser(userData);
      } catch (error) {
        console.error("Failed to fetch user", error);
      }
    };

    fetchUser();
  }, [userId]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUser((prevUser) => ({
      ...prevUser,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await updateUser(userId, user);
      navigate("/adminhome");
    } catch (error) {
      console.error("Failed to update user", error);
    }
  };

  return (
    <div>
      <h2>Edit User</h2>

      <form onSubmit={handleSubmit}>
        <p className="name">Title</p>
        <input
          type="text"
          placeholder="Your class title"
          name="title"
          value={editClass.title}
          onChange={handleChange}
        />
        <p className="name">Descriptions</p>
        <textarea
          placeholder="Enter your class descriptions"
          name="description"
          value={editClass.description}
          onChange={handleChange}
        />
        <p className="name">Class Type</p>
        <select
          name="class_type"
          value={editClass.class_type}
          onChange={handleChange}
        >
          <option value="{editClass.class_type}"></option>
          {classTypes.map((type, index) => (
            <option key={index} value={type}>
              {type}
            </option>
          ))}
        </select>
        <p className="name">Class Lesson</p>
        <textarea
          placeholder="What is primarily taught in your Class?"
          name="lesson"
          value={editClass.lesson}
          onChange={handleChange}
        />
        <div className="lesson-preview">
          <h4>Lesson Preview:</h4>
          <ul>
            {preview.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>
        </div>
        <p className="name">Price</p>
        <input
          type="text"
          placeholder="Rp.xxx.xxx"
          name="price"
          value={editClass.price}
          onChange={handleChange}
        />
        <div className="button-group">
          <button className="save-button" type="submit">
            Save
          </button>
        </div>
      </form>


      <form onSubmit={handleSubmit}>
        <div>
          <label>Username:</label>
          <input type="text" name="username" value={user.username} onChange={handleChange} />
        </div>
        <div>
          <label>Email:</label>
          <input type="email" name="email" value={user.email} onChange={handleChange} />
        </div>
        <div>
          <label>Full Name:</label>
          <input type="text" name="full_name" value={user.full_name} onChange={handleChange} />
        </div>
        <div>
          <label>User Type:</label>
          <input type="text" name="user_type" value={user.user_type} onChange={handleChange} />
        </div>
        <div>
          <label>Password:</label>
          <input type="password" name="password" value={user.password} onChange={handleChange} />
        </div>
        <button type="submit">Update User</button>
      </form>
    </div>
  );
};

export default EditUserAdmin;
